/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER ActualizarLotes_PedidoCancelado
AFTER UPDATE
   ON pedidos FOR EACH ROW
BEGIN
if new.estado <> old.estado and new.estado='CANCELADO' THEN
begin
UPDATE lotes l
inner join pedidos_lotes_producto plp on plp.id_lote=l.id_lote
SET
cantidad = cantidad+plp.cantidad_solicitada
WHERE plp.id_pedido=NEW.id_pedido;
end;
END IF;
END */;;
DELIMITER ;
