CREATE TABLE `producto` (
  `id_producto` bigint(20) NOT NULL AUTO_INCREMENT,
  `codigo` varchar(25) COLLATE utf8_unicode_ci NOT NULL,
  `Nombre_producto` varchar(100) COLLATE utf8_unicode_ci NOT NULL,
