  `existencia_Min` int(11) NOT NULL,
  `existencia_Max` int(11) NOT NULL,
  `imagen` varchar(50) COLLATE utf8_unicode_ci NOT NULL DEFAULT 'prod_default2015.jpg',
  `id_categoria` bigint(20) NOT NULL,
  `id_proveedor` bigint(20) NOT NULL,
  `f_modificacion` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `estado` char(1) COLLATE utf8_unicode_ci NOT NULL,
  PRIMARY KEY (`id_producto`),
  KEY `id_categoria` (`id_categoria`),
  KEY `id_proveedor` (`id_proveedor`),
  CONSTRAINT `producto_ibfk_1` FOREIGN KEY (`id_categoria`) REFERENCES `categoria_prod` (`id_categoria`),
