CREATE DEFINER=`root`@`localhost` PROCEDURE `BuscarEmpleadoPorNombreUsuario`(in usuario varchar(30))
begin
select e.id_empleado,p.nombres,concat(p.primer_apellido,' ',p.segundo_apellido) as apellidos,emp.Nombre_Empresa,emp.id_empresa from empleado e
left join persona p on p.id_persona=e.id_persona
left join usuarios u on e.id_empleado=u.id_empleado
left join empresa emp on emp.id_empresa=e.id_empresa
where u.usuario=usuario and u.estado=1 and e.estado=1 and emp.estado=1;
end ;;
DELIMITER ;
