CREATE DEFINER=`root`@`localhost` PROCEDURE `CargarDetallesVenta`(in idpedido int)
begin
SELECT  
sum(case when p.estado='EMITIDO' then plp.cantidad_solicitada when p.estado='ENTREGADO' then plp.cantidad_entregada else plp.cantidad_solicitada end) as cantidad,
plp.precio,prod.descripcion as descripcion_presentacion,prod.descripcion as descripcion_producto,prod.imagen,
(sum(case when p.estado='EMITIDO' then plp.cantidad_solicitada when p.estado='ENTREGADO' then plp.cantidad_entregada else plp.cantidad_solicitada end) *plp.precio) as subt 
/*pp.id_presentacion_producto, sum(plp.cantidad_solicitada) */
FROM pedidos P
LEFT JOIN pedidos_lotes_producto plp on plp.id_pedido=p.id_pedido
left join lotes l on l.id_lote = plp.id_lote
left join producto prod on prod.id_producto=l.id_producto
where p.id_pedido=idpedido
group by  p.id_pedido,prod.id_producto;
end ;;
DELIMITER ;
