CREATE DEFINER=`root`@`localhost` PROCEDURE `CargarTodosProductos`(in id_empresa int)
begin
select prod.id_producto,prod.Nombre_producto as nombre_prod,prod.descripcion as desc_presenta,prod.imagen,
prod.precio_sugerido,c.descripcion as desc_categoria,
(select case when sum(l.cantidad) is null then 0 else sum(l.cantidad) end as cantidad from lotes l where prod.id_producto=l.id_producto and estado=1)as cantidad_disponible
from  producto prod
left join categoria_prod c on c.id_categoria=prod.id_categoria
left join proveedores pv on pv.id_proveedor=prod.id_proveedor
where pv.id_empresa=id_empresa;
end ;;
