CREATE DEFINER=`root`@`localhost` PROCEDURE `CargarVentasPorEmpleado`(in IdEmpleado int)
begin
select p.id_pedido,p.id_cliente,p.id_empleado,p.fecha_pedido,p.estado,p.fecha_entrega,
(select descripcionCorta from tipo_pago tp where tp.id_tipo_pago = p.id_tipo_pago) as tipo_pago,
(select sum(
(case when p.estado='EMITIDO' then plp.cantidad_solicitada when p.estado='ENTREGADO' then plp.cantidad_entregada else plp.cantidad_solicitada end)
*plp.precio) from pedidos_lotes_producto plp
where plp.id_pedido=p.id_pedido) as subtotal,
p.iva,p.retencion_ir,p.pago_imi from pedidos p
/*left join pedidos_lotes_producto plp on plp.id_pedido=p.id_pedido
left join lotes l on l.id_lote=plp.id_lote
left join presentacion_producto pp on pp.id_presentacion_producto=l.id_presentacion_producto
left join presentacion pres on pres.id_presentacion=pp.id_presentacion
left join producto prod on prod.id_producto=pp.id_producto*/
where p.id_empleado= IdEmpleado
group by p.id_pedido
order by p.id_pedido asc;
end ;;
