CREATE DEFINER=`root`@`localhost` PROCEDURE `EliminarCliente`(
in id_clientex int,
out filas_afectadas int
)
begin
DECLARE NClientes INT;
set NClientes=(select count(id_cliente) from cliente where id_cliente=id_clientex);
if NClientes=1 then
begin
START TRANSACTION;
UPDATE `cliente`
SET
`estado` = '0'
WHERE `id_cliente` =id_clientex;
SET filas_afectadas = ROW_COUNT();
COMMIT;
end;
else
SET filas_afectadas = -1;
end if;
select filas_afectadas;
end ;;
DELIMITER ;
