CREATE DEFINER=`root`@`localhost` PROCEDURE `InsertarProductosPedido`(
in IdPedido varchar(15),
in IdProducto int(11), 
in CantidadSolicitada int(11),
in Precio float,
out IdProdPedidox int(11))
begin
declare IdLote int;
declare CantidadSobrante int;
declare CantidadDisponibleLote int;
set IdLote = (select l.id_lote from lotes l where l.id_producto=IdProducto and l.cantidad>0 and l.estado=1 order by l.fecha_vencimiento limit 1);
set CantidadDisponibleLote = (select l.cantidad from lotes l where l.id_lote = IdLote);

if CantidadDisponibleLote>=CantidadSolicitada then
INSERT INTO `pedidos_lotes_producto`
(`id_pedido`,
`id_lote`,
`cantidad_solicitada`,
`cantidad_entregada`,
`precio`)
VALUES
(IdPedido,
IdLote,
CantidadSolicitada,
0,
Precio);
else
INSERT INTO `pedidos_lotes_producto`
(`id_pedido`,
`id_lote`,
`cantidad_solicitada`,
`cantidad_entregada`,
`precio`)
VALUES
(IdPedido,
IdLote,
CantidadDisponibleLote,
0,
Precio);
set CantidadSobrante =  CantidadSolicitada-CantidadDisponibleLote;
WHILE CantidadSobrante <> 0 DO
set IdLote = (select l.id_lote from lotes l where l.id_producto=IdProducto and l.cantidad>0 and l.estado=1 order by l.fecha_vencimiento limit 1);
set CantidadDisponibleLote = (select l.cantidad from lotes l where l.id_lote = IdLote);
if CantidadDisponibleLote>=CantidadSobrante then
INSERT INTO `pedidos_lotes_producto`
(`id_pedido`,
`id_lote`,
`cantidad_solicitada`,
`cantidad_entregada`,
`precio`)
VALUES
(IdPedido,
IdLote,
CantidadSobrante,
0,
Precio);
set CantidadSobrante=0;
else
INSERT INTO `pedidos_lotes_producto`
(`id_pedido`,
`id_lote`,
`cantidad_solicitada`,
`cantidad_entregada`,
`precio`)
VALUES
(IdPedido,
IdLote,
CantidadDisponibleLote,
0,
Precio);
set CantidadSobrante =CantidadSobrante-CantidadDisponibleLote;
end if;
END WHILE;
END IF;
set IdProdPedidox=LAST_INSERT_ID();
select IdProdPedidox;
end ;;
DELIMITER ;
/*!50003 SET sql_mode              = @saved_sql_mode */ ;
/*!50003 SET character_set_client  = @saved_cs_client */ ;
/*!50003 SET character_set_results = @saved_cs_results */ ;
/*!50003 SET collation_connection  = @saved_col_connection */ ;
