CREATE DEFINER=`root`@`localhost` PROCEDURE `ObtenerClientesPorEmpresa`(
in id_empresa int,
in estados int)
begin
select c.id_cliente,c.nombre_negocio,c.longitud,c.latitud,pp.nombres,concat(pp.primer_apellido,' ',pp.segundo_apellido) as apellidos, 
count(p.id_pedido) as numerof,pp.cedula,pp.email,pp.direccion,pp.telefono,emp.id_empresa,c.id_ruta,c.estado from cliente c
left join persona pp on pp.id_persona=c.id_persona
left join pedidos p on p.id_cliente = c.id_cliente
left join rutas r on c.id_ruta=r.id_ruta
left join empresa emp on emp.id_empresa=r.id_empresa
where (estados=2 or(c.estado=estados))
and emp.id_empresa= id_empresa 
group by c.id_cliente;
end ;;
