CREATE DEFINER=`root`@`localhost` PROCEDURE `ObtenerPedidosPorCliente`(
in id_cliente int,
in estados varchar(10))
begin
select p.id_pedido,p.id_cliente,p.id_empleado,p.fecha_pedido,p.estado,p.fecha_entrega,
(select descripcionCorta from tipo_pago tp where tp.id_tipo_pago = p.id_tipo_pago) as tipo_pago,
(select sum(
(case when p.estado='SOLICITADO' then plp.cantidad_solicitada when p.estado='ENTREGADO' then plp.cantidad_entregada else plp.cantidad_solicitada end)
*plp.precio) from pedidos_lotes_producto plp
where plp.id_pedido=p.id_pedido) as subtotal,
p.iva,p.retencion_ir,p.pago_imi 
from pedidos p 
left join cliente c on p.id_cliente = c.id_cliente
left join persona pp on pp.id_persona=c.id_persona
left join rutas r on c.id_ruta=r.id_ruta
left join empresa emp on emp.id_empresa=r.id_empresa
left join pedidos_repartidor pr on pr.id_pedido=p.id_pedido
left join empleado e on e.id_empleado=pr.id_repartidor
where (estados='Todos' or(p.estado=estados))
and c.id_cliente= id_cliente
group by p.id_pedido;
end ;;
DELIMITER ;
