CREATE DEFINER=`root`@`localhost` PROCEDURE `ObtenerProductosPorEmpresa`(
in id_empresa int,
in estados int)
begin
select p.*,case when (select sum(l.cantidad) from lotes l where l.id_producto=p.id_producto)>=0 then
(select sum(l.cantidad) from lotes l where l.id_producto=p.id_producto)
else 0 end as cantidad_disponible from producto p
left join proveedores pv on pv.id_proveedor=p.id_proveedor
left join empresa e on e.id_empresa= pv.id_empresa
where (estados=2 or(p.estado=estados))
and e.id_empresa= id_empresa 
group by p.id_producto;
end ;;
DELIMITER ;
