CREATE DEFINER=`root`@`localhost` PROCEDURE `ObtenerProductosPorPedido`(in idpedido int)
begin
SELECT  p.id_pedido,
sum(case when p.estado='SOLICITADO' then plp.cantidad_solicitada when p.estado='ENTREGADO' then plp.cantidad_entregada else plp.cantidad_solicitada end) as cantidad,
plp.precio,prod.descripcion as descripcion_presentacion,prod.nombre_producto as descripcion_producto,prod.imagen,
(sum(case when p.estado='SOLICITADO' then plp.cantidad_solicitada when p.estado='ENTREGADO' then plp.cantidad_entregada else plp.cantidad_solicitada end) *plp.precio) as subt 
/*pp.id_presentacion_producto, sum(plp.cantidad_solicitada) */
FROM pedidos P
inner JOIN pedidos_lotes_producto plp on plp.id_pedido=p.id_pedido
left join lotes l on l.id_lote = plp.id_lote
left join producto prod on prod.id_producto=l.id_producto
where p.id_pedido=idpedido
group by  p.id_pedido,prod.id_producto;
end ;;
