CREATE DEFINER=`root`@`localhost` PROCEDURE `ObtenerProductosPorRepartidor`(
in id_repartidor int)
begin
select p.id_producto,sum(plp.cantidad_solicitada) as total_a_entregar,p.Nombre_producto,p.descripcion,p.imagen,pv.id_proveedor,pv.Nombre_Proveedor
from producto p
left join lotes l on l.id_producto=p.id_producto
left join pedidos_lotes_producto plp on plp.id_lote=l.id_lote
left join pedidos pd on pd.id_pedido=plp.id_pedido
LEFT JOIN pedidos_repartidor pr on pr.id_pedido=pd.id_pedido
left join proveedores pv on pv.id_proveedor=p.id_proveedor
where pd.estado='ASIGNADO' AND pr.id_repartidor=id_repartidor
group by p.id_producto,p.Nombre_producto,p.descripcion,p.imagen,pv.id_proveedor,pv.Nombre_Proveedor;
end ;;
