CREATE DEFINER=`root`@`localhost` PROCEDURE `ObtenerUsuariosPorEmpresa`(
in id_empresa int,
in estados int)
begin
select u.usuario,u.estado,empl.codigo_empleado,p.nombres,p.primer_apellido,p.segundo_apellido,p.telefono,c.descripcion from usuarios u 
left join empleado empl on empl.id_empleado=u.id_empleado
left join persona p on empl.id_persona=p.id_persona
left join cargos c on empl.id_cargo=c.id_cargo
left join empresa emp on emp.id_empresa=empl.id_empresa
where (estados=2 or(u.estado=estados and empl.estado=estados))
and emp.id_empresa= id_empresa 
group by emp.id_empresa,empl.codigo_empleado;
end ;;
