CREATE DEFINER=`root`@`localhost` PROCEDURE `VerificarDatosAppMovil`(in usuariox varchar(30), in contrasenax varchar(40),in device_id varchar(128),out Validacion boolean)
begin
declare NResultados int;
declare NDevices int;

declare Validacion boolean;

/*declare usuariox varchar(30);
declare contrasenax varchar(40); 
declare device_id varchar(128);*/
declare id_disp int;

/*set usuariox='rta91';
set contrasenax='8cb2237d0679ca88db6464eac60da96345513964';
set device_id ='3518030601026801';*/
set NDevices=0;

set NResultados = (select count(u.usuario) from usuarios u
inner join empleado e on e.id_empleado=u.id_empleado
where (u.usuario=usuariox and u.contrasena=contrasenax) and (u.Estado=1 and e.Estado=1));

if(NResultados=1) then
set NDevices= (select count(dm.id_dispositivo) from dispositivos_moviles dm where dm.Dispositivo_ID=device_id and dm.estado=1);
end if;

set id_disp=(select dm.id_dispositivo from dispositivos_moviles dm where dm.Dispositivo_ID=device_id and dm.estado=1 limit 1);
if(NResultados=1 and NDevices=1) then
update dispositivos_moviles 
set ultima_usuario_acceso=usuariox,ultima_fecha_acceso=Now()
where id_dispositivo=id_disp;
set Validacion=true;
else
set Validacion=false;
end if;
/*
SELECT u.usuario, u.Contrasena
FROM usuarios u 
inner join empleado e on e.id_empleado=u.id_empleado
inner join dispositivos_moviles dm on dm.id_empresa=e.id_empresa
WHERE 
(u.usuario=usuariox and u.contrasena=contrasena and dm.Dispositivo_ID=device_id) and 
u.Estado=1 and e.Estado=1 and dm.estado=1;
*/
select Validacion;
end ;;
